import "./Footer.css";
import Insta from "@iconscout/react-unicons/icons/uil-instagram";

const Footer = () => {
  return (
    <footer>
      <div className="f-content">
        <span>Raheleh1392@gmail.com</span>
        <Insta size="3rem" color="white" />
      </div>
    </footer>
  );
};

export default Footer;
